import "./Portfolio.css";

export function Portfolio() {

  let data : PortfolioItem[] = ():ortfolioItem[]  => {
    for(let i = 0; i < 10; i++) {

    }
    return data
  }

  return (
    <div className="portfolio-page flex">
      <div className="portfolio-page-container">
        <div className="portfolio-title section-title">
          Portfolio <span>.</span>
        </div>

        {/* rest of the stuff */}
      </div>
    </div>
  );
}

class PortfolioItem {
  title: string;
  description: string;
  imageUrl: string;
  link: string;
  techStack?: string[];

  constructor(
    title: string,
    description: string,
    imageUrl: string,
    link: string,
    techStack?: string[]
  ) {
    this.title = title;
    this.description = description;
    this.imageUrl = imageUrl;
    this.link = link;
    this.techStack = techStack;
  }

  display() {
    return (
      <>
        <div>this.title</div>
        <div>this.description</div>
      </>
    )
  }
}
